#size = 200 * 200
.section .bss
	.comm res 80000
	.comm temp 128
.section .text
.global _start

_start:
	movl $0, %esi # %esi/2 = matrix #1 row index(address)
	movl $0, %edi # %edi/2 = matrix #2 col index(address)
L2:
	movl $0, %ecx # compute m3[%esi/2, %edi/2]
	movl $0, %eax
	xorps %xmm2, %xmm2
L1:#compute 1 element in the result matrix
	imul $200, %esi, %edx # %edx is the corresponding row address of matrix #1
						  # each row has 200 elements, which is 400 bytes, 
						  # edx = 200 * 2 * %esi/2
	movups m1(%edx, %ecx, 1), %xmm0 # %xmm0 = m1[%esi/2, %ecx/2]
	                                # repeat 8 times
	
	imul $200, %ecx, %edx # %edx is the (%ecx/2)th row address of matrix #2
						  # each row has 200 elements, which is 400 bytes
						  # edx = 200 * 2 * %ecx/2

	movups m2(%edx, %edi, 1), %xmm1 # xmm1 = m2[%ecx/2, %edi/2]
	                                # repeat 8 times
	

	pmullw %xmm0, %xmm1 # xmm1 = m2[%ecx/2, %edi/2] * m1[%esi/2, %ecx/2]
	                    # from low to high, repeat 8 times
	
	paddusw %xmm1, %xmm2
	
	addl $16, %ecx
	cmpl $400, %ecx
	jnz L1
	
# now xmm2 is the sum of 8 couple, sum them up
	movups %xmm2, temp # 8 shorts in temp
	xorps %xmm2, %xmm2
	movl $0, %ecx
	movl $0, %ebx
L3:
	movl temp(%ecx), %edx # two shorts in edx
	addw %dx, %bx
	shr $16, %edx 
	addw %dx, %bx
	addl $4, %ecx
	cmpl $16, %ecx
	jnz L3
	
	imul $200, %esi, %edx
	movl %eax, res(%edx, %edi, 1)
	addl $2, %edi # increase col index
	cmpl $400, %edi
	jnz L2 
	
	movl $0, %edi # set col index to 0
	addl $2, %esi # increase row index
	cmpl $400, %esi 
	jnz L2
	
	movl $0, %ebx
	movl $1, %eax
	int $0x80
	
